function doSelectingCPM()
{
	var i = 0, j = 1; k = 2; // counters: i, itinerary; j, flight; k, segment
	var nAirport, oAirport, dAirport, mileage;
	var price, currency, amount, amountPlus, segs, cpm;
	var inject;
	
	// nAirport is the aa.com identifier for the airports
	nAirport = '1' + (i+1) + '111'; // crazy, BTW
	
	// for each itinerary
	for (i=0; $('#originAirport' + nAirport).length != 0; i++)
	{
		// get 'price' (= currency + amount)
		price = $("label[for='ess-" + i + "']").text();
		
		// if there is a price, i.e., if the box doesn't show "Not Available"
		if ( price.length != 0)
		{
			// find the currency symbol and the amount
			currency = price.match(/(\044|£|Bs)/);
			amount = price.match(/\d+/);
			
			mileage = 0;
			// for each flight (number) in an itinerary, get the mileage
			for (j=1; $('#originAirport' + nAirport).length != 0; j++)
			{
				// get the outbound airport code, then the inbound airport code
				oAirport = $('#originAirport' + nAirport).text();
				dAirport = $('#departureAirport' + nAirport).text();
				// console.log(oAirport + " to " + dAirport);
				
				// for each segment in a single flight (number), change the destination airport to the last airport
				for (k=1; $('#departureAirport' + '1' + (i+1) + '1' + j + k).length != 0; k++)
				{
					dAirport = $('#departureAirport' + '1' + (i+1) + '1' + j + k).text();
				}
				
				// calculate the mileage between the two airports
				mileage += getMileage(oAirport,dAirport);
				
				// up the ID value for the airports, then get the next outbound flight node
				nAirport = '1' + (i+1) + '1' + (j+1) + '1';
			}
			
			if (j>1 || k>2) segs=2;
			else segs=1;
			if (currency[0] == "$") amountPlus = parseFloat(amount) + 9.95 * segs;
			else if (currency[0] == "£") amountPlus = parseFloat(amount);
			console.log("amountPlus " + amountPlus);
			
			// calculate cpm
			cpm = Math.round( amountPlus / mileage * 100 * 100 ) / 100;
			console.log("cpm " + cpm);
			
			// append cpm
			$("label[for='ess-" + i + "']").append( "<span style='color:red;' class='cpm'><br />&#126;" + cpm + " CPM</span>", "<span class='mileage'><br />&#126;" + mileage + " mi</span>" );
		}
		// up the ID value for the airports, then get the next outbound flight node
		nAirport = '1' + (i+2) + '111';
	}
};

