function degToRad(deg)
{
	return ( deg * ( Math.PI / 180 ));
};

function mileageCalc(lat1, lon1, lat2, lon2)
{
	var kms, er = 6371;
	kms = Math.acos( Math.sin(lat1) * Math.sin(lat2) + Math.cos(lat1) * Math.cos(lat2) * Math.cos( lon2 - lon1 )) * er;
	mileage = Math.round(kmsToMiles(kms));
	return mileage;
}

function kmsToMiles(kms)
{
	return ( kms * 0.621371192237);
};

